import React, {useState} from 'react';
import Sdata from './myjson';

const App2 = () => {

  return (
    <div>
      {Sdata.map((elm, ind) => {
          <ul key={ind}>
              <li>{elm.id}</li>
              <li>{elm.sname}</li>
          </ul>
      })}
    </div>
  )
}

export default App2
